import building from './../image/section1Building'

const SectionOne = () => {
  return (
    <div>
        <div>
            <h1>Find your perfect home <span>Anywhere</span></h1>
        </div>
      <img src={building} alt="" />
    </div>
  )
}

export default SectionOne
